import React from "react";
import "./App.css";
import { Map, Marker } from "pigeon-maps";





function App() {


  return (
    <div className='App'>
      <header>eatAll</header>
      <div className="mapper"><Map height={400} defaultCenter={[40.712776, -74.005974]} defaultZoom={15}>
        <Marker width={50} anchor={[40.712776, -74.005974]} />
      </Map></div>
      <h1>Display Radio Buttons</h1>
      <div>
        <form>
          <input type="radio" name="choice" value="yes" id="choice-yes">
            <label for="choice-yes">Yes</label></input>
            <input type="radio" name="choice" value="no" id="choice-no">
              <label for="choice-no">No</label></input>
        </form>
      </div>
    </div>
      );
}

      export default App;
